class MeventDetailComponent {
    constructor(authService, router, route, themes, _location, confirmDialogService, lang) {
        this.authService = authService;
        this.router = router;
        this.route = route;
        this.themes = themes;
        this._location = _location;
        this.confirmDialogService = confirmDialogService;
        this.lang = lang;
        this.eventDetails = null;
        this.showImage = false;
        this.displayError = false;
        this.organizerDetails = [];
        this.unapprovedParticipants = [];
        this.approvedParticipants = [];
        this.memImg = [];
        this.alluserInformation = [];
        this.fileArray = [];
        this.showToggle = false;
    }
    ngOnInit() {
        if (localStorage.getItem('club_theme') != null) {
            let theme = JSON.parse(localStorage.getItem('club_theme'));
            this.setTheme = theme;
        }
        this.activatedSub = this.themes.club_theme.subscribe((resp) => {
            this.setTheme = resp;
        });
        this.userDetails = JSON.parse(localStorage.getItem('user-data'));
        this.role = this.userDetails.roles[0];
        this.userId = this.userDetails.userId;
        this.getAllUserInfo();
        this.language = this.lang.getLanguaageFile();
        this.route.params.subscribe(params => {
            const eventid = params['eventid'];
            this.getEventDetails(eventid);
        });
    }
    goBack() {
        this._location.back();
    }
    getEventDetails(eventid) {
        if (sessionStorage.getItem('token')) {
            this.authService.setLoader(true);
            this.authService.memberSendRequest('get', 'get-event-by-id/' + eventid, null)
                .subscribe((respData) => {
                this.authService.setLoader(false);
                this.eventDetails = respData['result'][0];
                if (this.eventDetails) {
                    if (this.eventDetails.picture_video != null) {
                        var url = this.eventDetails.picture_video.split('\"');
                        let self = this;
                        url.forEach(element => {
                            self.showImage = true;
                            if ((element.endsWith(".jpg")) || (element.endsWith(".jpeg")) || (element.endsWith(".png") ||
                                (element.endsWith(".gif")) || (element.endsWith(".svg")) || (element.endsWith(".webp")) ||
                                (element.endsWith(".avif")) || (element.endsWith(".apng")) || (element.endsWith(".jfif")) ||
                                (element.endsWith(".pjpeg")) || (element.endsWith(".pjp")))) {
                                self.showImage = true;
                                self.fileArray.push(element);
                                self.imageurl = self.fileArray[0];
                            }
                            if ((element.endsWith(".pdf")) || (element.endsWith(".doc")) || (element.endsWith(".zip")) ||
                                (element.endsWith(".docx")) || (element.endsWith(".docm")) || (element.endsWith(".dot")) ||
                                (element.endsWith(".odt")) || (element.endsWith(".txt")) || (element.endsWith(".xml")) ||
                                (element.endsWith(".wps")) || (element.endsWith(".xps")) || (element.endsWith(".html")) ||
                                (element.endsWith(".htm")) || (element.endsWith(".rtf")) || (element.endsWith(".xlsx"))) {
                                self.docFile = element;
                            }
                        });
                    }
                    this.getOrganizerDetails(eventid);
                    this.getParticipantDetails(eventid);
                }
            });
        }
    }
    getOrganizerDetails(eventid) {
        if (sessionStorage.getItem('token')) {
            this.authService.setLoader(true);
            this.authService.memberSendRequest('get', 'approvedParticipants/event/' + eventid, null)
                .subscribe((respData) => {
                this.authService.setLoader(false);
                for (const key in respData) {
                    if (Object.prototype.hasOwnProperty.call(respData, key)) {
                        const element = respData[key];
                        if (this.eventDetails.author == element.users.id) {
                            this.organizerDetails.push(element.users);
                            Object(this.organizerDetails).forEach((val, key) => {
                                // console.log(val);
                                if (this.alluserInformation[val.id] != null) {
                                    this.authService.memberInfoRequest('get', 'profile-photo?database_id=' + this.userDetails.database_id + '&club_id=' + this.userDetails.team_id + '&member_id=' + this.alluserInformation[val.id].member_id, null)
                                        .subscribe((resppData) => {
                                        this.thumb = resppData;
                                        val.image = this.thumb;
                                    });
                                }
                                else {
                                    val.image = null;
                                }
                            });
                            // console.log(this.organizerDetails);
                        }
                        else {
                            this.approvedParticipants.push(element);
                            Object(this.approvedParticipants).forEach((val, key) => {
                                if (this.alluserInformation[val.users.id].member_id != null) {
                                    this.authService.memberInfoRequest('get', 'profile-photo?database_id=' + this.userDetails.database_id + '&club_id=' + this.userDetails.team_id + '&member_id=' + this.alluserInformation[val.users.id].member_id, null)
                                        .subscribe((resppData) => {
                                        this.thumb = resppData;
                                        val.users.image = this.thumb;
                                    });
                                }
                                else {
                                    val.users.image = null;
                                }
                            });
                        }
                    }
                }
            });
        }
    }
    getParticipantDetails(eventid) {
        if (sessionStorage.getItem('token')) {
            this.authService.setLoader(true);
            this.authService.memberSendRequest('get', 'unapprovedParticipants/event/' + eventid, null)
                .subscribe((respData) => {
                this.authService.setLoader(false);
                this.unapprovedParticipants = respData;
                Object(this.unapprovedParticipants).forEach((val, key) => {
                    if (this.alluserInformation[val.id].member_id != null) {
                        this.authService.memberInfoRequest('get', 'profile-photo?database_id=' + this.userDetails.database_id + '&club_id=' + this.userDetails.team_id + '&member_id=' + this.alluserInformation[val.id].member_id, null)
                            .subscribe((resppData) => {
                            this.thumb = resppData;
                            val.image = this.thumb;
                        });
                    }
                    else {
                        val.image = null;
                    }
                    this.memImg.push(val);
                });
                this.authService.setLoader(false);
            });
        }
    }
    getMemId(id) {
        this.thumbnail = '';
        let self = this;
        $("#profileSpinner").show();
        if (sessionStorage.getItem('token')) {
            this.authService.setLoader(true);
            this.authService.memberSendRequest('get', 'get-club-info/' + this.userDetails.database_id + '/' + this.userDetails.team_id, this.userDetails)
                .subscribe((respData) => {
                this.authService.setLoader(false);
                this.getclubInfo = respData;
            });
        }
        this.authService.memberSendRequest('get', 'teamUsers/team/' + this.userDetails.team_id, null)
            .subscribe((respData) => {
            var arry = [];
            arry = respData;
            arry.forEach(element => {
                if (element.id == id) {
                    this.authService.memberSendRequest('get', 'member-info/' + this.userDetails.database_id + '/' + this.userDetails.team_id + '/' + element.member_id, null)
                        .subscribe((respData) => {
                        if (respData['success'] == false) {
                            setTimeout(() => {
                                this.displayError = true;
                                $("#profileSpinner").hide();
                                $("#exampleModal").hide();
                            }, 2000);
                        }
                        else {
                            this.birthdateStatus = respData['shareBirthday'];
                            this.authService.memberSendRequest('get', 'profile-info/' + this.userDetails.database_id + '/' + this.userDetails.team_id + '/' + element.member_id, null)
                                .subscribe((resp) => {
                                if (resp) {
                                    this.profile_data = resp;
                                    this.memberStartDateStatus = this.profile_data.membershipStartDate;
                                    this.authService.memberInfoRequest('get', 'profile-photo?database_id=' + this.userDetails.database_id + '&club_id=' + this.userDetails.team_id + '&member_id=' + element.member_id, null)
                                        .subscribe((respData) => {
                                        if (respData == '' || respData == null) {
                                            this.thumbnail = 'assets/img/defaultProfile.jpeg';
                                        }
                                        else {
                                            this.thumbnail = respData;
                                        }
                                    }, (err) => {
                                        this.thumbnail = 'assets/img/defaultProfile.jpeg';
                                        // setTimeout(() => {
                                        $("#profileSpinner").hide();
                                        // }, 2000);
                                        console.log(err);
                                    });
                                    $("#profileSpinner").hide();
                                }
                                else {
                                    setTimeout(() => {
                                        this.displayError = true;
                                        $("#profileSpinner").hide();
                                    }, 2000);
                                }
                            });
                        }
                    });
                }
            });
        });
    }
    onShow() {
        let el = document.getElementsByClassName("bunch_drop");
        if (!this.showToggle) {
            this.showToggle = true;
            el[0].className = "bunch_drop show";
        }
        else {
            this.showToggle = false;
            el[0].className = "bunch_drop";
        }
    }
    deleteEvents(eventId) {
        let self = this;
        this.confirmDialogService.confirmThis(this.language.confirmation_message.delete_event, function () {
            self.authService.setLoader(true);
            self.authService.memberSendRequest('delete', 'event/' + eventId, null)
                .subscribe((respData) => {
                self.authService.setLoader(false);
                const url = ["/organizer"];
                self.router.navigate(url);
            });
        }, function () {
            $('.dropdown-toggle').trigger('click');
        });
    }
    getAllUserInfo() {
        let self = this;
        this.authService.memberSendRequest('get', 'teamUsers/team/' + this.userDetails.team_id, null)
            .subscribe((respData) => {
            Object(respData).forEach((val, key) => {
                this.alluserInformation[val.id] = { member_id: val.member_id };
            });
        });
    }
    ngOnDestroy() {
        this.activatedSub.unsubscribe();
    }
}
