    getMemId(id) {
        this.thumbnail = '';
        let self = this;
        self.collaboratorDetails.forEach(element => {
            if (element.id == id) {
                self.mem_id = element.user_id;
            }
        });
        $("#profileSpinner").show();
        if (sessionStorage.getItem('token')) {
            this.authService.setLoader(false);
            this.authService.memberSendRequest('get', 'get-club-info/' + this.userDetails.database_id + '/' + this.userDetails.team_id, this.userDetails)
                .subscribe((respData) => {
                this.authService.setLoader(false);
                this.getclubInfo = respData;
            });
        }
        this.authService.memberSendRequest('get', 'teamUsers/team/' + this.userDetails.team_id, null)
            .subscribe((respData) => {
            var arry = [];
            arry = respData;
            arry.forEach(element => {
                if (element.id == self.mem_id) {
                    this.authService.memberSendRequest('get', 'member-info/' + this.userDetails.database_id + '/' + this.userDetails.team_id + '/' + element.member_id, null)
                        .subscribe((respData) => {
                        if (respData['success'] == false) {
                            setTimeout(() => {
                                this.displayError = true;
                                $("#profileSpinner").hide();
                            }, 2000);
                        }
                        else {
                            this.birthdateStatus = respData['shareBirthday'];
                            this.authService.memberSendRequest('get', 'profile-info/' + this.userDetails.database_id + '/' + this.userDetails.team_id + '/' + element.member_id, null)
                                .subscribe((resp) => {
                                if (resp) {
                                    this.profile_data = resp;
                                    this.memberStartDateStatus = this.profile_data.membershipStartDate;
                                    this.authService.memberInfoRequest('get', 'profile-photo?database_id=' + this.userDetails.database_id + '&club_id=' + this.userDetails.team_id + '&member_id=' + element.member_id, null)
                                        .subscribe((respData) => {
                                        if (respData == '' || respData == null) {
                                            this.thumbnail = 'assets/img/defaultProfile.jpeg';
                                        }
                                        else {
                                            this.thumbnail = respData;
                                        }
                                    }, (err) => {
                                        this.thumbnail = 'assets/img/defaultProfile.jpeg';
                                        // setTimeout(() => {
                                        $("#profileSpinner").hide();
                                        // }, 2000);
                                        console.log(err);
                                    });
                                }
                                else {
                                    setTimeout(() => {
                                        this.displayError = true;
                                        $("#profileSpinner").hide();
                                    }, 2000);
                                }
                            });
                        }
                    });
                }
            });
        });
    }
