    base64ToFile(data, filename) {
        const arr = data.split(',');
        const mime = arr[0].match(/:(.*?);/)[1]; //image type formate
        const bstr = atob(arr[1]); //atob() function decodes a string of data which has been encoded using Base64 encoding.
        let n = bstr.length;
        let u8arr = new Uint8Array(n); //The Uint8Array() constructor creates a typed array of 8-bit unsigned integers. The contents are initialized to 0.
        while (n--) {
            u8arr[n] = bstr.charCodeAt(n);
        }
        return new File([u8arr], filename, { type: mime });
    }
